import React, { useState, useEffect } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import TableContainer from '@mui/material/TableContainer';
import Table from '@mui/material/Table';
import TableHead from '@mui/material/TableHead';
import TableBody from '@mui/material/TableBody';
import TableRow from '@mui/material/TableRow';
import TableCell from '@mui/material/TableCell';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import Dialog from '@mui/material/Dialog';
import { Stack } from '@mui/system';
import InputLabel from '@mui/material/InputLabel';
import FormControl from '@mui/material/FormControl';
import { Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';
import axios from 'axios';

function DepartmentHeadScoreCSB02() {
    // State for select field
    const [projectSelect, setProjectSelect] = useState(null);
    const [projects, setProjects] = useState([]);
    const [examScores, setExamScores] = useState([]);
    const [openDialog, setOpenDialog] = useState(false);

    // Fetch project data
    useEffect(() => {
        const fetchProjects = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Project');
                setProjects(response.data);
            } catch (error) {
                console.error('Error fetching project data:', error);
            }
        };

        fetchProjects();
    }, []);

    // Fetch exam results data
    useEffect(() => {
        const fetchExamScores = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Exam_results');
                setExamScores(response.data);
            } catch (error) {
                console.error('Error fetching exam results data:', error);
            }
        };

        fetchExamScores();
    }, []);

    // Handle select change
    const handleChange = (event) => {
        const selectedProject = projects.find(project => project.ID === event.target.value);
        setProjectSelect(selectedProject);
    };

    // Handle form submission
    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:9999/Exam_results', formData);
            console.log('Subject added:', response.data);
            alert("Subject added successfully!");
            // Reset form after successful submission
            setFormData({
                Er_name: '',
                Er_results: '',
                Er_com: '',
                Er_status: '',
                Er_date: '',
                Er_time: ''
            });
        } catch (error) {
            console.error('Error adding subject:', error);
            alert("Failed to add subject. Please try again later.");
        }
    };

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}></Grid>
                            <div>
                                <Box
                                    fontSize='18px'
                                    sx={{
                                        marginTop: 5,
                                    }}
                                >
                                    <h1>แบบประเมินโครงงานพิเศษ 1 (สอบก้าวหน้า)</h1>
                                    {/* Select field */}
                                    <p>เลือกชื่อโครงงาน</p>
                                    <FormControl>
                                        <InputLabel id="ProjectID-select-label">ProjectID</InputLabel>
                                        <Select
                                            labelId="ProjectID-select-label"
                                            value={projectSelect?.ID || ''}
                                            onChange={handleChange}
                                            label="ProjectID"
                                            margin="normal"
                                            sx={{
                                                minWidth: 150,
                                            }}
                                        >
                                            {projects.map((project) => (
                                                <MenuItem
                                                    key={project.ID}
                                                    value={project.ID}
                                                >
                                                    {project.Name}
                                                </MenuItem>
                                            ))}
                                        </Select>
                                    </FormControl>
                                    <TextField
                                        disabled
                                        id="Name"
                                        label="ชื่อโครงงาน"
                                        value={projectSelect?.Name || 'ชื่อโครงงาน'}
                                        sx={{
                                            '& > :not(style)': { ml: 5, width: '50ch' },
                                        }}
                                    />
                                    <br />

                                    {/* Disabled text fields */}
                                    <p>โดย</p>
                                    <TextField
                                        label="รหัสนักศึกษาคนที่ 1"
                                        value={projectSelect?.SID || 'รหัสนักศึกษาคนที่ 1'}
                                        disabled
                                        sx={{
                                            '& > :not(style)': { mr: 5, ml: 5, width: '25ch' },
                                        }}
                                    />
                                    <TextField
